  const [articleData, setArticleData] = useState('')

  useEffect(() => {
    setTimeout(() => {
      // @ts-ignore
      if (document.__article) {
        // @ts-ignore
        setArticleData(document.__article.author)
      }
    }, 3000)
  }, [])

  return (
    // <div>{articleData}</div>
    <BrowserRouter>
      <Header />
      <div>
        <Routes>
          <Route path='/' element={<HomePage />} />
        </Routes>
      </div>
    </BrowserRouter>
  )
}

export default App
